'''Dark warriors''' are mainly found in the [[Dark Warriors' Fortress]], a castle in level 12 to 16 [[Wilderness]] north-west of [[Edgeville]].

There are a mix of combat level 8 and 145 on the {{FloorNumber|uk=0}} and only combat level 8 dark warriors on the {{FloorNumber|uk=1}}. They are usually more annoying than an actual threat to players, and have higher defence than their combat level suggests.

